import React from 'react';
import { Link } from 'react-router-dom'; // Import Link from react-router-dom
import UserList from './UserList';

const Dashboard = () => {
  return (
    <div>
      <h2>Dashboard</h2>
      {/* Render the UserList component within the Dashboard */}
      <UserList />
      {/* Add a Link to navigate to the Users.js file */}
      <Link
        to="/users" // Specify the path to the Users.js route
        className="bg-indigo-500 hover:bg-indigo-700 text-white font-bold py-2 px-4 rounded mt-4 block text-center"
      >
        View Users
      </Link>
    </div>
  );
};

export default Dashboard;
